import React from 'react';
import './SearchBar.css';

const SearchBar = () => {
  return (
    <div className="searchbar">
      <div>
        <input
          className="search_input"
          type="text"
          id="search"
          placeholder="Search"
        ></input>
        <button className="search_button" type="submit"></button>
      </div>
    </div>
  );
};

export default SearchBar;
